function PopUpShow(){$("#pop-up-form").fadeIn()}function PopUpHide(){$("#pop-up-form").fadeOut()}function FaqHide(){$(".faq-hidden-text").hide()}function FaqOpen(){$(this).siblings(".faq-hidden-text").toggle()}function SubmitForm(){let o=$("#form");return $.post(o.attr("action"),o.serialize()),!1}$(document).ready((function(){PopUpHide(),$(".carousel_slick").slick({autoplay:!0,arrows:!1,dots:!0,slidesToShow:3,adaptiveHeight:!0}),FaqHide()})),$("#pop-up").click(PopUpShow),$("#pop-up-close").click(PopUpHide),$(".faq-toggle").click(FaqOpen),$("#count-minus").click((function(){var o=$("#count"),t=parseInt(o.val())-1;return t=t<1?1:t,o.val(t),!1})),$("#count-plus").click((function(){var o=$("#count");return o.val(parseInt(o.val())+1),!1})),$("form").submit(SubmitForm);